import React from 'react'

export default class ColorSelect extends React.Component{

    render(){
        return(
            <div className="ui four item menu">
                <div onClick={() => this.props.onChange('red')} className='ui red button'>Red</div>
                <div onClick={() => this.props.onChange('yellow')} className='ui yellow button'>Yellow</div>
                <div onClick={() => this.props.onChange('blue')} className='ui blue button'>Blue</div>
                <div onClick={() => this.props.onChange('red')} className='ui green button'>Green</div>
            </div>
        )
    }
}
